import React from "react";
import { Modal } from "antd";
const CustomModal = ({ visible, handleOk }) => {
  return (
    <Modal
      visible={visible}
      onOk={handleOk}
      onCancel={() => visible(false)}
    ></Modal>
  );
};

export default CustomModal;
